import axios from 'axios';

export const login = async (email='',password='') => {
    const res = await axios.post('http://localhost:8000/api/v1/sesion/login',
        {email,password},
        {

            headers: {
                'Access-Control-Allow-Origin': '*',
                'Content-Type': 'application/json',
            }
        });

    console.log(res);

    return res;
}
